@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent {

  appName:string = 'fundamentals-app';


}
<div class="container">
  <h1>
    <img width="75" height="75" />
    Fundamentos Angular {{ appName }}
  </h1>
</div>
